import React from 'react';
import { Card } from 'react-bootstrap';

const ReviewsList = (props) => {
    const {reviews} = props;
    const reviewList = reviews.map(review => {
        return (
            <div>
                <Card>
                    <Card.Title>
                        <h1>{ review.name }</h1>
                    </Card.Title>
                </Card>
            </div>
        );
    })
    return (
        <div>
            { reviewList }
        </div>
    );
}

export default ReviewsList;
